svg.script:
window.console.log("In my script block");

// From https://wiki.inkscape.org/wiki/index.php/SVG_with_javascript
function on_load(evt) {
  window.console.log("In my on_load with ", evt);
  O = evt.target;
  svgDocument = O.ownerDocument;
  // Need a way to identify all animatable items..
  // or just stick the damn onmouseenter on each item.
  els = svgDocument.querySelectorAll('.chemicals-processes');
  els.forEach(el => {
    el.onmouseenter = highlightCat('chemicals-processes');
  });
}


function highlightCat(cat) {
  els = document.querySelectorAll('.' + cat);
  els.forEach(el => {
    el.classList.add('highlight');
  }); 
}
// TODO: classList.remove("highlight") of all existing,
